function orbitalPeriod(arr) {
  var GM = 398600.4418;
  var earthRadius = 6367.4447;
  var a = 2*Math.PI;
  var newArr = [];

  var getAnswer = function(obj){
      var c = Math.pow(earthRadius + obj.avgAlt, 3);
      var b = Math.sqrt(c/GM);
      var ans = Math.round(a*b);
      return {name: obj.name,orbitalPeriod: ans};
  };
  for(let elem in arr){
      newArr.push(getAnswer(arr[elem]))
  }
  return newArr;
}

